import React from 'react';

import classes from './MovieTemp.module.css';

const MovieTemp = (props) => {
    return (
        <li className={classes.movie}>
            <h2>{props.title}</h2>
            <h3>{props.releaseDate}</h3>
            <p>{props.openingText}</p>
        </li>
    );
};

export default MovieTemp;
